    false,nt"url": null,nt"notes": "Boat-based creel survey data have been
    collected and processed by the American Samoa Department of Marine and Wildlife
    Resources (DMWR) staff since about 1982 and are continuing.  Creel surveys consist
    of 2 major sub-surveys, one to identify the level of fishing participation for each
    fishing method used in the Territory, and one to determine the catch rate, species
    composition, and sizes of fish (and invertebrates) for each fishing method and fishing
    sector. The most structured and consistent surveys have been conducted on the main
    island of Tutuila and there are also some less robust data for the Manu'a islands.
    Boat-based surveys are access-point surveys and include all major and some minor
    ports and marinas where fishing boats launch or are berthed. Fishing areas are limited
    to the areas around American Samoa as boats included in these surveys are generally
    less than about 40 feet. These data are considered confidential.",nt"owner_org":
